package net.yozo.services.common;import net.yozo.core.dao.page.PagerModel;import java.io.Serializable;import java.util.Date;public class Download extends PagerModel implements Serializable {	private static final long serialVersionUID = 1L;	private String id;	private String account;	private String productID;	private Date lastDownloadTime;		public void clear() {		super.clear();		id = null;		account = null;		productID = null;		lastDownloadTime = null;	}	public String getId() {		return id;	}	public void setId(String id) {		this.id = id;	}	public String getAccount() {		return account;	}	public void setAccount(String account) {		this.account = account;	}	public String getProductID() {		return productID;	}	public void setProductID(String productID) {		this.productID = productID;	}	public Date getLastDownloadTime() {		return lastDownloadTime;	}	public void setLastDownloadTime(Date lastDownloadTime) {		this.lastDownloadTime = lastDownloadTime;	}}